Features
AUDITORIUM CUTAWAY BODY
With dimensions of 117mm(4 5/8") body depth, upper bout width at 292mm(11 1/2") and lower bout width at 405mm(16"), the Grand Regals body size is perfectly in between the large Dreadnought and the more intimate Grand Concert. This makes the Grand Regal ideal for both strumming/flatpicking and fingerstyle playing and suits the versatile acoustic player who prefers to have one guitar to cover a variety of sounds and playing styles.&nbsp;
SPRUCE TOP
Spruce provides an ideal balance between strength and flexibility, hence its overwhelming popularity as the wood of choice for tops of acoustic guitars. Spruces versatile sonic character makes it ideal for a variety of musical genres and playing styles.
&nbsp;
MAHOGANY BACK &amp; SIDES
Bright yet natural with a strong and warm midrange, the beloved mahogany wood has been a standard for back and sides on premium acoustics for many decades.&nbsp;
CE306T PREAMP
The CE306T is a very versatile acoustic preamp with a large, and clear LCD display tuner that is very easy to read and offers a wide range of sounds from its responsive 4-band EQ tuned specifically for acoustic guitars that will be useful for a variety of musical applications.
&nbsp;
